import {
    BrowserRouter,
    Switch,
    Route,
    Routes,
    Redirect, useNavigate
} from "react-router-dom";
import React from "react";
import BookListRender from "./BookListRender";
import IndividualBook from "./IndividualBook";

function Book(props) {

    const navigate = useNavigate();

    const navigateBook = () => {
        // üëáÔ∏è navigate to /
        navigate('/individualBook');
    };

    return (
        <div>
            <form onClick={navigateBook}>
                <button className="book">
                    <div >
                        <img alt="NA" />
                        <h1>{props.name}</h1>
                        <p>{props.author}</p>
                    </div>
                </button>
            </form>
            <BrowserRouter>
                <Routes>
                    {/* <Route exact path="/" element={<BookListRender/>} /> */}
                    <Route path="/individualBook" element={<IndividualBook id={props.id} />} />
                </Routes>
            </BrowserRouter>
        </div>
    );
}

export default Book;
